visualeditor-changedesc-align:
Fallback description of an item's 'align' attribute value change for visual diffing, if no specific i18n exists for that kind of item.

Values:
* $1 – Previous align value, like 'left'. {{Raw parameter}}
* $2 – New align value, like 'center'. {{Raw parameter}}
{{Related|Visualeditor-changedesc}}

visualeditor-changedesc-changed:
Fallback description of an attribute value change for visual diffing, if no specific i18n exists for that kind of change.

Values:
* $1 – Attribute name, like 'lang' or 'dir'
* $2 – Previous attribute value, like 'ar' or 'rtl'. {{Raw parameter}}
* $3 – New attribute value, like 'fa' or 'auto'. {{Raw parameter}}
{{Related|Visualeditor-changedesc}}

visualeditor-changedesc-comment:
Description of a comment's change for visual diffing.

Values:
* $1 – Previous comment. {{Raw parameter}}
* $2 – New comment. {{Raw parameter}}
{{Related|Visualeditor-changedesc}}

visualeditor-changedesc-direction:
Description of a language annotation's direction change for visual diffing.

Values:
* $1 – Previous direction, like 'ltr' or 'rtl'. {{Raw parameter}}
* $2 – New direction, like 'rtl' or 'ltr'. {{Raw parameter}}
{{Related|Visualeditor-changedesc}}

visualeditor-changedesc-image-size:
Description of an image's size change for visual diffing.

Values:
* $1 – Previous size, like '200x133px'. {{Raw parameter}}
* $2 – New size, like '300x200px'. {{Raw parameter}}
{{Related|Visualeditor-changedesc}}

visualeditor-changedesc-language:
Description of a language annotation's language change for visual diffing.

Values:
* $1 – Previous language, like 'ar' or 'fr'. {{Raw parameter}}
* $2 – New language, like 'de' or 'fa'. {{Raw parameter}}
{{Related|Visualeditor-changedesc}}

visualeditor-changedesc-link-href:
Description of a links's target change for visual diffing.

Values:
* $1 – Previous target, like 'Hello world' or 'https://www.wikimedia.org/'. {{Raw parameter}}
* $2 – New target, like 'Hello Earth' or 'https://www.mediawiki.org/'. {{Raw parameter}}
{{Related|Visualeditor-changedesc}}

visualeditor-changedesc-no-key:
Fallback description of an value change for visual diffing, if no specific i18n exists for that attribute.

Values:
* $1 – Previous attribute value, like 'header' or 'rtl'. {{Raw parameter}}
* $2 – New attribute value, like 'content' or 'ltr'. {{Raw parameter}}
{{Related|Visualeditor-changedesc}}

visualeditor-changedesc-set:
Fallback description of an attribute value being set for visual diffing, if no specific i18n exists for that kind of change.

Values:
* $1 – Attribute name, like 'lang' or 'dir'
* $2 – New attribute value, like 'fa' or 'auto'. {{Raw parameter}}
{{Related|Visualeditor-changedesc}}

visualeditor-changedesc-unset:
Fallback description of an attribute value being unset for visual diffing, if no specific i18n exists for that kind of change.

